import React from 'react'

interface ImageProps {
  imageBase64: string;
  onError?: () => void;
}

const Image = (props: ImageProps) => {
  return  (
    <img 
      src={ "data:image/png;base64," + props.imageBase64} 
      onError={() => {
        props.onError && props.onError();
      }}
    />
  );
}

export default Image;
